import TaskList from "./TaskList";

const AllTasks = (props) => {
    return(
        <div>
            <TaskList listItem= {props.items[0].title}/>
            <TaskList listItem= {props.items[1].title}/>
            <TaskList listItem= {props.items[2].title}/>
            <TaskList listItem= {props.items[3].title}/>
        </div>
    );
}

export default AllTasks;
